import axios from 'axios'

export default(formData) =>{
    const deleteExpensePromise = axios({
        url:`${window.apiHost}/roommates/delete/:id`,
        method:"POST",
        data: formData
    })
    return{
        type:"DELETE_EXPENSE_ACTION",
        payload: deleteExpensePromise
    }
}
